PART II.  EXPORTS:  FRUITS, VEGETABLES,
NUTS, AND COFFEE

Note

  Part heading amended by L 1983, c 257, §5.

     For the purposes of this part, unless otherwise required by the context:
	"Agricultural commodity" means fruits, vegetables, nuts, and coffee;
	"Commercial exporter" means any person who is engaged in the business of exporting fresh or processed agricultural commodities to points outside the State;
	"Department" means the department of agriculture;
	"Processed" means canned, preserved, frozen, pickled, dried, or otherwise prepared with or without any ingredients added thereto;
	"Style" means the kind or class of any particular processed agricultural commodity as determined by its physical characteristics, usually the size and shape thereof. [L 1955, c 258, §3; RL 1955, §22-21; am L 1959, c 267, §1; am L Sp 1959 2d, c 1, §22; am L 1961, c 132, §2; HRS ; am L 1983, c 257, pt of §5]
